import React, { Component } from "react"
import {
  HighLightWrapper,
  HighLightParagraph,
  HighLightTitle,
} from "./styles/style"

class HighLight extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return (
      <>
        <HighLightWrapper>
          <HighLightTitle>Highlights</HighLightTitle>
          <HighLightParagraph>
            Visit eight villages showcasing Polynesian culture Canoe ride,
            tattoos, spear throwing, ukulele lessons and fishing Spectacular
            Polynesian evening dinner show ‘Ha: Breath of Life’ Optional
            transportation from Waikiki hotels
          </HighLightParagraph>
        </HighLightWrapper>
      </>
    )
  }
}

export default HighLight
